import QuestionItem from 'components/QuestionItem'
import styles from './QuestionCard.module.css'

const QuestionCard = ({ title, show, visibility, image, questions }) => {
    return (
        <>
            <div style={{display: visibility, listStyleType: 'none'}} className={styles.tile} onClick={show}>
                <ul>
                    <li>
                        {title}
                    </li>
                    {/* <QuestionItem visibility={visibility} questions={questions} /> */}
                </ul>
            </div>
            <div>
                <img src={image} width='30px' height='30px' className={styles.image} />
            </div>
        </>
    )
}

export default QuestionCard
